import React, { useState, useEffect } from 'react';
import { useNavigate } from 'react-router-dom';

const BudgetManagement = () => {
  const navigate = useNavigate();
  const [trip, setTrip] = useState('');
  const [budget, setBudget] = useState('');
  const [remainingBudget, setRemainingBudget] = useState(0);
  const [totalExpenses, setTotalExpenses] = useState(0);
  const [progress, setProgress] = useState(0);

  useEffect(() => {
    const token = localStorage.getItem('token');
    if (!token) {
      navigate('/');
      return;
    }
    fetchBudgetData();
  }, [navigate]);

  const fetchBudgetData = async () => {
    try {
      const token = localStorage.getItem('token');
      const response = await fetch('http://localhost:5000/api/budget', {
        headers: {
          'Authorization': `Bearer ${token}`,
        },
      });

      if (response.ok) {
        const data = await response.json();
        setTrip(data.trip);
        setBudget(data.budget);
        setTotalExpenses(data.totalExpenses);
        calculateRemainingBudget(data.budget, data.totalExpenses);
      } else if (response.status === 401) {
        localStorage.removeItem('token');
        navigate('/');
      } else {
        const error = await response.json();
        alert(error.message || 'Failed to fetch budget data.');
      }
    } catch (error) {
      console.error('Error fetching budget data:', error);
      alert('Failed to fetch budget data. Please try again.');
    }
  };

  const handleSubmit = async (event) => {
    event.preventDefault();
    const token = localStorage.getItem('token');

    if (!token) {
      navigate('/');
      return;
    }

    const budgetValue = parseFloat(budget);
    if (isNaN(budgetValue) || !trip) {
      alert('Please enter a valid budget and trip.');
      return;
    }

    const budgetData = {
      trip,
      budget: budgetValue,
    };

    try {
      const response = await fetch('http://localhost:5000/api/budget', {
        method: 'POST',
        headers: {
          'Content-Type': 'application/json',
          'Authorization': `Bearer ${token}`,
        },
        body: JSON.stringify(budgetData),
      });

      if (response.ok) {
        const data = await response.json();
        setBudget(data.budget);
        setTotalExpenses(data.totalExpenses);
        calculateRemainingBudget(data.budget, data.totalExpenses);
        alert('Budget set successfully!');
      } else if (response.status === 401) {
        localStorage.removeItem('token');
        navigate('/');
      } else {
        const error = await response.json();
        alert(error.message || 'Failed to set budget. Please try again.');
      }
    } catch (error) {
      console.error('Error setting budget:', error);
      alert('Failed to set budget. Please try again.');
    }
  };

  const calculateRemainingBudget = (budget, expenses) => {
    const remaining = budget - expenses;
    setRemainingBudget(remaining);
    const progressPercentage = (expenses / budget) * 100;
    setProgress(progressPercentage);
  };

  return (
    <div className="container mt-5">
      <div className="text-center mb-5">
        <h2 className="display-4 mb-3">Budget Management</h2>
        <h3 className="text-muted">Remaining Budget: ${remainingBudget.toFixed(2)}</h3>
      </div>

      <form onSubmit={handleSubmit} className="bg-light p-4 rounded shadow-sm">
        <div className="mb-3">
          <label htmlFor="trip" className="form-label">Trip Name:</label>
          <input
            type="text"
            id="trip"
            className="form-control"
            value={trip}
            onChange={(e) => setTrip(e.target.value)}
            required
          />
        </div>

        <div className="mb-3">
          <label htmlFor="budget" className="form-label">Budget Amount:</label>
          <input
            type="number"
            id="budget"
            className="form-control"
            value={budget}
            onChange={(e) => setBudget(e.target.value)}
            required
            step="0.01"
            min="0"
          />
        </div>

        <div className="d-grid">
          <button type="submit" className="btn btn-primary">Set Budget</button>
        </div>
      </form>

      <div className="progress mt-5" style={{ height: '25px' }}>
        <div
          className="progress-bar"
          role="progressbar"
          style={{ width: `${progress}%` }}
          aria-valuenow={progress}
          aria-valuemin="0"
          aria-valuemax="100"
        >
          {progress.toFixed(2)}%
        </div>
      </div>
    </div>
  );
};

export default BudgetManagement;
